Zu mir ich bin Jungler/Top und bereits alte 21 Jahre.
Ich war diese Season bereits Platin 4 gewesen, bin aber aufgrund von Inaktivit&auml;t und Ungl&uuml;ck zur&uuml;ck in Gold gedroppt.

Zu dir - du solltest Gold 3 + sein, um die 18 Jahre aufw&auml;rts sein und auch definitiv relaxt sein wenn es auch mal nicht so Laufen sollte. {{summoner:13}} 

Wenn du Interesse hast einfach Ingame adden (LeagueofDunking) und mir eine Nachricht hinterlassen. {{champion:3}}
